funcSearch:
  function funcSearch() {
    log("funcReserve");

    const els = resHisListDiv.gtn("li");
    const dictCourse = {
      1: "단일",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      if(!el.gtn("button")[2]) return true;
      const param = el.gtn("button")[2].attr("onclick").inparen();
      const [date, course, , , time] = param;

      console.log("reserve search", course, dictCourse[course], date, time);
      result.push({ date, time, course: dictCourse[course] });
    });
    const param = {
      golf_club_id: "e1652e6e-f091-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      log(data);
      LOGOUT();
      funcEnd();
    });
  }
